style.css:
/* Change background color */
body {
    background-color: lime; /* Change to your preferred color */
}

/* Change text color */
p, h1, h2, h3, h4, h5, h6 {
    color: #333; /* Change to your preferred color */
}

/* Change font */
body {
    font-family: Arial, sans-serif; /* Change to your preferred font */
}

/* Increase font size */
p, h1, h2, h3, h4, h5, h6 {
    font-size: 16px; /* Change to your preferred font size */
}

/* Adjust spacing */
p {
    line-height: 1.5; /* Change to your preferred line height */
    margin-bottom: 20px; /* Change to your preferred margin */
}
